                // Prepare the nodes and links for highlighting
                graphData.links.forEach(link => {
                    const a = graphData.nodes[link.source];
                    const b = graphData.nodes[link.target];
                    !a.neighbors && (a.neighbors = []);
                    !b.neighbors && (b.neighbors = []);
                    a.neighbors.push(b);
                    b.neighbors.push(a);

                    !a.links && (a.links = []);
                    !b.links && (b.links = []);
                    a.links.push(link);
                    b.links.push(link);
                });

                const highlightNodes = new Set();
                const highlightLinks = new Set();
                let hoverNode = null;

                // Create the 3D force graph
                const Graph = ForceGraph3D()(document.getElementById('3d-graph'))
                    .graphData(graphData)
                    .nodeColor(node => highlightNodes.has(node) ? node === hoverNode ? 'rgb(255,0,0,1)' : 'rgba(255,160,0,0.8)' : 'rgba(0,255,255,0.6)')
                    .linkColor(link => highlightLinks.has(link) ? 'rgba(255, 165, 0, 1)' : 'rgba(255,255,255,0.6)')
                    .linkWidth(link => highlightLinks.has(link) ? 1 : 1)
                    .linkDirectionalParticles(link => highlightLinks.has(link) ? 4 : 0)
                    .linkDirectionalParticleWidth(0.5)
                    .nodeLabel(node => `Coordinate x: ${node.x.toFixed(2)}<br>Coordinate y: ${node.y.toFixed(2)}<br>Coordinate z: ${node.z.toFixed(2)}`)  // Relevant line for node hover!!!
                    .onNodeHover(node => {
                        // no state change
                        if ((!node && !highlightNodes.size) || (node && hoverNode === node)) return;

                        highlightNodes.clear();
                        highlightLinks.clear();
                        if (node) {
                            highlightNodes.add(node);
                            node.neighbors.forEach(neighbor => highlightNodes.add(neighbor));
                            node.links.forEach(link => highlightLinks.add(link));
                        }

                        hoverNode = node || null;

                        updateHighlight(Graph);
                    });

                function updateHighlight(Graph) {
                    // trigger update of highlighted objects in scene
                    Graph
                        .nodeColor(Graph.nodeColor())
                        .linkWidth(Graph.linkWidth())
                        .linkDirectionalParticles(Graph.linkDirectionalParticles());
                }

                // Initialize nodes with positions from JSON without fixing them
                graphData.nodes.forEach(node => {
                    node.fx = node.x;
                    node.fy = node.y;
                    node.fz = node.z;
                });

                // Update the graph with initialized positions
                Graph.graphData(graphData);

                // Fit the graph to the screen after a short delay
                setTimeout(() => {
                    console.log('Attempting to fit the graph to the screen.');
                    Graph.zoomToFit(400);  // The duration can be adjusted
                    console.log('Fitting attempted.');
                }, 1000);  // Delay in milliseconds
            } catch (error) {
                console.error('Error fetching the graph data:', error);
            }
        }

        // Call the function to fetch data and create the graph
        fetchGraphData();
